import React, { useState } from "react";

function Input() {
  const placeholder = "Tekstą įkelkite čia";

  return (
    <div className="input-fields">
      <div className="buttons">
        <button type="button">
          Iš teksto<span>Struktūrizuoti iš teksto</span>
        </button>
        <button type="button">
          Iš nuorodos<span>Struktūrizuoti iš nuorodos</span>
        </button>
        <button type="button">
          Iš failo<span>Struktūrizuoti iš .pdf</span>
        </button>
      </div>
      <div className="input-field">
        <input placeholder={placeholder}></input>
      </div>
    </div>
  );
}

export default Input;
